import { useEffect } from "react";
import { Button, OverlayTrigger, Popover, Table } from "react-bootstrap";
import { useDispatch } from "react-redux";
import { getLogs } from "../../actions/logs";

const LogItem = ({log}, key) => {
    const dispatch = useDispatch()
    const renderSwitchSubject = (subjtype) =>
        {
            switch(subjtype)
            {
                case "Сотрудник":
                    {
                        const popover = (
                            <Popover id="popover-basic">
                                <Popover.Title as="h3">{log.subject.first_name}</Popover.Title>
                                <Popover.Content>
                                <Table striped bordered hover size="sm" onClick={e => e.preventDefault()}>
                                      <thead>
                                          <tr>
                                            <th>ID</th>
                                              <th>Имя</th>
                                              <th>Фамилия</th>
                                          </tr>
                                      </thead>
                                      <tbody>
                                            <tr>
                                            <th>{log.subject.emplid}</th>
                                              <th>{log.subject.first_name}</th>
                                              <th>{log.subject.last_name}</th>
                                            </tr>
                                      </tbody>
                                  </Table>
                              </Popover.Content>
                            </Popover>
                          );
                        return (
                            <OverlayTrigger trigger="focus" placement="right" overlay={popover}>
                                <Button variant="light">{log.subject.first_name}</Button>
                            </OverlayTrigger>
                        
                        )
                    }
                    
    
                default:
                return log.subjid
            }
        };

        const renderSwitchObject = (objtype) =>
        {
            switch(objtype)
            {
                case "Ключ":
                    {
                        const popover = (
                            <Popover id="popover-basic">
                                <Popover.Title as="h3">{log.obj.keyid}</Popover.Title>
                                <Popover.Content>
                                <Table striped bordered hover size="sm" onClick={e => e.preventDefault()}>
                                      <thead>
                                          <tr>
                                            <th>ID</th>
                                              <th>Кабинет</th>
                                          </tr>
                                      </thead>
                                      <tbody>
                                            <tr>
                                            <th>{log.obj.keyid}</th>
                                              <th>{log.obj.cabinet}</th>
                                            </tr>
                                      </tbody>
                                  </Table>
                              </Popover.Content>
                            </Popover>
                          );
                        return (
                            <OverlayTrigger trigger="focus" placement="right" overlay={popover}>
                                <Button variant="light">{log.obj.keyid}</Button>
                            </OverlayTrigger>
                         )
                    }
                default:
                return log.subjid
            }
        };
    return (
        
    <tr key={key}>
        <td>{log.subjtype}</td>
        <td>{renderSwitchSubject(log.subjtype)}</td>
        <td>{log.act}</td>
        <td>{log.objtype}</td>
        <td>{renderSwitchObject(log.objtype)}</td>
        <td>{log?.time}</td>
    </tr>
    );
};

export default LogItem ;
